import React from "react";
import './PcCard.css'

const PcCard = ({ charName, playerName, concept, image }) => {
  return(
    <article className="pc-card">
      <h2>{CharName}</h2>
      <h3>{concept}</h3>
      <h3>played by: {playerName}</h3>
      <div>{image}</div>
    </article>
  )
}

export default PcCard
